    // Function to create a new campaign slot
function createSlot(uint256 _campaignID, uint256 _slotID, bytes32 _slotData) external {
    CampaignSlots memory newSlot = CampaignSlots({
        slotID: _slotID,
        campaignID: _campaignID,
        slotData: _slotData
